import React, { useEffect, useState } from "react";
import "./style.css";

export default function Episode(props) {
    useEffect(() => {

    })
    function onChangeEp(e,key){
        console.log("props.epKey",key);

        props.setEpisode({sv:0,ep:0});
    }
    return (
        <li onClick={(e)=>{onChangeEp(e,props.epKey)}} className={"episode " + (props.active && "active")}>
            <span>{props.data.label}</span>
        </li>
    );

}
